INSERT INTO `zt_history`(`id`,`action`,`field`,`old`,`new`,`diff`) VALUES ('299','722','desc','<p>
	短信通知 + 系统消息：
</p>
<p>
	短信通知后台增加配置。
</p>
<p>
	消息内容：
</p>
<p>
	<br /></p>
<p>
	<br /></p>
<h3>
	1、买入提示信息（heart_transaction_pay）：成交后发给买方
</h3>
<br />
内容：你好，你正在买入爱心 ${heart_num} 个,需付款金额：${pay_money},请在${cancel_time}分钟内完成付款并在系统完成付款确认，详情查看“交易市场”-“我的订单”。<br /><br />
系统消息标题：你正在买入××爱心，请在××分钟内完成付款<br /><br /><h3>
	2、收款提示信息（heart_transaction_receive)：买方付款确认后发给卖方
</h3>
你好，你正在卖出爱心 ${heart_num} 个,对方已确认付款：${pay_money},请及时完成“收款确认”，详情查看“交易市场”-“我的订单”。<br /><br />
系统消息标题：你正在卖出××爱心，对方已付款，请在××分钟内完成收款确认<br /><br /><h3>
	3、交易完成（heart_transaction_finish)：卖方收款确认后发给双方
</h3>
<br />
你好，你${user}的爱心,数量：${heart_num} ,金额：${pay_money},已完成交易。<br /><br />
注：${user} == 买入或者卖出<br /><br />
系统消息标题：你${user}的爱心,数量：${heart_num} ,金额：${pay_money},已完成交易<br /><br /><h3>
	4、交易取消（heart_transaction_cancel)：买方付款前人工取消交易或者超时未付款
</h3>
<br />
