	4、交易取消（heart_transaction_cancel)：买方付款前人工取消交易或者超时未付款&nbsp; --SMS_161570027
</h3>
<br />
你好，你${user}的爱心,数量：${heart_num} ,金额：${pay_money},因:${cancel_reason},交易中止。<br /><br />
