INSERT INTO `zt_task`(`id`,`parent`,`project`,`module`,`story`,`storyVersion`,`fromBug`,`name`,`type`,`pri`,`estimate`,`consumed`,`left`,`deadline`,`status`,`color`,`mailto`,`desc`,`openedBy`,`openedDate`,`assignedTo`,`assignedDate`,`estStarted`,`realStarted`,`finishedBy`,`finishedDate`,`finishedList`,`canceledBy`,`canceledDate`,`closedBy`,`closedDate`,`closedReason`,`lastEditedBy`,`lastEditedDate`,`deleted`) VALUES ('62','0','14','0','0','1','0','爱心交易市场功能实现','devel','2','10','50','0','2019-03-14','done','','','<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:-36pt;\">
	<span>一、&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>爱心交易市场<span><br /></span>一、交易规则：（实名认证后的正式用户可以交易）<span></span> 
</p>
<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:0cm;\">
	<span>&nbsp;&nbsp; OTC</span>场外交易： <span>1</span>、用户实名认证后可设置购买单和（价格、数量）<span><br />
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2</span>、卖家与买家匹配后买家需要在<span>30</span>分钟之内付款<span></span> 
</p>
<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:132pt;\">
	给卖家（买家直接打款到卖家提供的收款账号里 <span></span> 
</p>
<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:132pt;\">
	面，平台不参与交易资金结算）否则取消该比单<span></span> 
</p>
<p class=\"MsoNormal\">
	<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3</span>、卖家收到买家的打款并核实无误后在平台确认收<span></span> 
</p>
<p class=\"MsoNormal\">
	<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>款，系统自动扣除卖家账户“爱心”（手续费<span>20% </span> 
</p>
<p class=\"MsoNormal\">
	<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>“爱心”由卖家出）到买家账户<span></span> 
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	二、交易手续费：爱心交易手续费<span>20%</span>由卖方出。收取的<span>20%</span>爱心手续<span></span> 
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>费系统自动销毁（例如：<span>a</span>要卖<span>100</span>颗爱心那么他账户<span></span> 
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>必须要有<span>100*0.2+100=120</span>颗爱心才可以匹配买家订<span></span> 
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>单，交易成功后买家账户增加<span>100</span>颗爱心。卖家账户<span></span> 
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>扣除<span>120</span>颗爱心，<span>100</span>颗给买家。<span>20</span>颗系统销毁）<span></span> 
</p>
<p class=\"MsoNormal\">
	开发类型：新增功能。
</p>
<p class=\"MsoNormal\">
	业务流程
</p>
<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:-36pt;\">
	1、&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
买家或卖家挂单（设置数量和单价，用户实名认证且是正式会员才能交易）
</p>
<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:-36pt;\">
	2、&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
买家或者卖家买单（需要有足够的爱心和爱心手续费），确认后冻结买单方爱心。
</p>
<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:-36pt;\">
	3、&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
购买方线下打款，打款后进订单点击“打款”。
</p>
<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:-36pt;\">
	4、&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
卖家收货确认
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	前台：实现交易页面，
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	后台：列出交易列表，可进行订单取消、收货确认、打款确认等操作供客服后期协调操作。
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	客户提供的草图：
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<span></span> 
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	&nbsp;
</p>
<p>
	<img src=\"{68.png}\" alt=\"\" /></p>
<p>
	&nbsp; &nbsp; 数据库表：dsc_heart_transaction，dsc_user_real
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<span style=\"font-weight:700;\">其它重要需求：</span> 
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<span style=\"font-weight:700;\">0、正式客户（微信授权、有购物）且实名认证的用户才能交易，为实名认证的直接跳转到认证页面</span>
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<span style=\"font-weight:700;\"><br /></span>
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<span style=\"font-weight:700;\">1、发布的订单有效期为1天（后台区块链-爱心设置-增加爱心交易订单有效期 transact_validate_time，单位分钟），1天后自动撤销(计划任务）</span> 
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<span style=\"font-weight:700;\">2、交易时间上午9：30—16：30，也可能临时开启和关闭。爱心设置增加 交易关闭和开启（<span style=\"font-weight:700;\">transaction_open）、开始时间</span><span style=\"font-weight:700;\">transaction_start_time 结束时间<span style=\"font-weight:700;\"></span><span style=\"font-weight:700;\">transaction_end_time</span></span></span> 
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<span style=\"font-weight:700;\">3、起订量（后台可设置 <span style=\"font-weight:700;\">transaction_order_min</span>）</span> 
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<span style=\"font-weight:700;\">4\\、订单匹配成功后超过30分钟未付款确认，自动取消（计划任务，后台设置取消时间<span style=\"font-weight:700;\">&nbsp;</span><span style=\"font-weight:700;\">transaction_wait_pay)</span></span> 
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<span style=\"font-weight:700;\"><span style=\"font-weight:700;\">5、重要节点发系统消息：匹配成功、已付款</span></span> 
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<span style=\"font-weight:700;\"><span style=\"font-weight:700;\"><span style=\"font-weight:700;\">6\\实名认证添加支付宝和微信收款二维码的上传（均非必填），当卖家挂单时默认显示</span><span>dsc_user_real中的付款信息，如果在挂单时上传支付宝和微信二维码同时更新到表</span><span>dsc_user_real</span><br /></span></span>
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<br /></p>','yidingzzj','2019-03-07 09:47:55','yidingzzj','2019-03-20 17:14:07','2019-03-09','2019-03-11','yidinglgt','2019-03-20 17:14:07','','','0000-00-00 00:00:00','','0000-00-00 00:00:00','','yidinglgt','2019-03-20 17:14:07','0');
