买家或者卖家买单（需要有足够的爱心和爱心手续费），确认后冻结买单方爱心。 </strong>
</p>
<strong> </strong>
<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:-36pt;\">
	<strong> 3、&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
购买方线下打款，打款后进订单点击“打款”。 </strong>
</p>
<strong> </strong>
<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:-36pt;\">
	<strong> 4、&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
卖家收货确认 </strong>
</p>
<strong> </strong>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<strong> 前台：实现交易页面， </strong>
</p>
<strong> </strong>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<strong> 后台：列出交易列表，可进行订单取消、收货确认、打款确认等操作供客服后期协调操作。 </strong>
</p>
<strong> </strong>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<strong> 客户提供的草图： </strong>
</p>
<strong> </strong>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<strong> <span></span> </strong>
</p>
<strong> </strong>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<strong> &nbsp;<img src=\"{67.png}\" alt=\"\" /></strong>
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<strong>其它重要需求：</strong>
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<strong>1、发布的订单有效期为1天（后台统一设定），1天后自动撤销</strong>
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<strong>2、交易时间上午9：30—16：30，也可能临时开启和关闭。（需要体现当前是营业状态或者非营业状态）</strong>
</p>
<p class=\"MsoNormal\" style=\"text-indent:36pt;\">
	<strong>3、起订量（后台可设置）</strong>
</p>
