INSERT INTO `zt_task`(`id`,`parent`,`project`,`module`,`story`,`storyVersion`,`fromBug`,`name`,`type`,`pri`,`estimate`,`consumed`,`left`,`deadline`,`status`,`color`,`mailto`,`desc`,`openedBy`,`openedDate`,`assignedTo`,`assignedDate`,`estStarted`,`realStarted`,`finishedBy`,`finishedDate`,`finishedList`,`canceledBy`,`canceledDate`,`closedBy`,`closedDate`,`closedReason`,`lastEditedBy`,`lastEditedDate`,`deleted`) VALUES ('59','0','13','0','0','1','0','显客宝目前开发完成的第一版本上线','test','3','0','0','0','2019-03-05','closed','',',yidinglrb','显客宝目前开发完成的第一版本上线，第二阶段迭代开发接口','admin','2019-03-01 17:09:10','closed','2019-08-21 08:36:41','2019-03-01','0000-00-00','','0000-00-00 00:00:00','','','0000-00-00 00:00:00','admin','2019-08-21 08:36:41','','admin','2019-08-21 08:36:41','0');
INSERT INTO `zt_task`(`id`,`parent`,`project`,`module`,`story`,`storyVersion`,`fromBug`,`name`,`type`,`pri`,`estimate`,`consumed`,`left`,`deadline`,`status`,`color`,`mailto`,`desc`,`openedBy`,`openedDate`,`assignedTo`,`assignedDate`,`estStarted`,`realStarted`,`finishedBy`,`finishedDate`,`finishedList`,`canceledBy`,`canceledDate`,`closedBy`,`closedDate`,`closedReason`,`lastEditedBy`,`lastEditedDate`,`deleted`) VALUES ('60','0','14','0','0','1','0','文章和商品分享时链接带上个人推广码','devel','1','16','20','0','2019-03-08','done','','','<p>
	</p><p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:0cm;\">
		<strong>功能描述</strong>
	</p>
	<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:0cm;\">
		文章、商品分享功能。分享出去的内容自带个人二维码，点开看到的人（未注册过平台用户）自动绑定该微信为该分享者的直推会员。（以后注册都是成为该分享者的直推）<span></span>
	</p>
	<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:0cm;\">
		<strong>功能分析：</strong>
	</p>
	<p class=\"MsoListParagraph\" style=\"margin-left:72pt;text-indent:-36pt;\">
		1、&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
文章和商品可进行分享，分享链接带上个人二维码&nbsp; <span style=\"color:#E53333;\">--郑章杰开发</span>
	</p>
	<p class=\"MsoListParagraph\" style=\"margin-left:72pt;text-indent:-36pt;\">
		2、&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
浏览链接的用户如果是未登录用户，则先进行微信授权，将该微信和分享者做绑定，以后该微信号注册时都是该分享者的直推会员&nbsp;<span style=\"color:#E53333;\"> --林广添开发</span>
	</p>
<strong>开发思路：</strong>

<p>
	1、会员分享（微信）产品或育婴学院的文章时会自动带上会员推荐码&nbsp;<span style=\"color:#E53333;\"> --郑章杰开发</span>
</p>
<p>
	2、会员打开的链接中如果有会员推荐码，如果会员啊未登录，则先微信授权，获得openid后和会员账号做绑定，后面会员注册时，如果使用该openid则自动成为分享人的直推。
</p>
<p>
	<span style=\"color:#E53333;\">--林广添开发</span>
</p>
<p>
	产品链接：/mobile/index.php?m=goods&amp;id=产品id&amp;u=会员推荐码
</p>
<p>
	孕婴学院文章链接：<strong>/mobile/index.php?m=college&amp;a=detail&amp;id=文章id&amp;u=会员推荐码</strong>
</p>
<p>
	<br /></p>','yidingzzj','2019-03-07 09:45:18','yidingzzj','2019-03-11 09:01:59','2019-03-07','2019-03-07','yidinglgt','2019-03-11 09:01:59','','','0000-00-00 00:00:00','','0000-00-00 00:00:00','','yidinglgt','2019-03-11 09:01:59','0');
